import React from "react";
import pizzas from "../Pizzadata";
import Pizzas from "../component/Pizzas";
export default function Homepage() {
  return (
    <div style={{ margin: "100px" }}>
      <div className="row ">
        {pizzas.map((pizza) => {
          return (
            <div className="col-md-4 ">
              <div>
                <Pizzas pizza={pizza} />
              </div>
            </div>
          );
        })}
      </div>
    </div>
  );
}
